"""##Funciones

Nos definimos todas las funciones a utilizar. Primero calculamos la energía por particula de una red cuadrada de ising con interaccion entre primeros vecinos en el estado s (solo se pueden tomar 2 estados, +1 y -1) Asumimos que no hay campo magnetico, que J =1 y que existe condiciones periódicas, es decir que el primer psin de cada fila/columna es vecino del ultimo. La energia total del sistema para una red $L\times L$ es:
$$ H(S) = -\sum_{i,j=1}^L S_{ij}( S_{i-1,j} + S_{i,j-1} ) $$

La energia por particula entonces va a ser:

$$ h = \frac{H}{L^2}$$
"""

@njit
def h(S):
    L = S.shape[0]
    E = 0.0

    for i in range(L):
        for j in range(L):
            # Vecinos "arriba" y "izquierda" con condiciones periódicas
            E += S[i, j] * (S[(i-1) % L, j] + S[i, (j-1) % L])

    return -E / (L * L)

"""Ahora me defino la funcion que aplica el algoritmo de metropolis. Esta funcion, al aplicarla sobre el estado s, devuelve un nuevo estado **s** y el incremento de la magentizacion (**dm**) y la energia (**de**). Consideramos primeros vecinos, por lo que solo tenemos 5 cambios de la energia posible al invertir un spin $$\Delta E = -8, -4, 0, 4 , 8$$

Si $\Delta E \le 0$ damos vuelta el spin, si en cambio $\Delta E>0$ lo damos vuelta con probabilidad $e^{-\beta\Delta E}$ de tal manera que, luego de ser iterado varias veces, el algoritmo empiece a generar estados distribuidos segun el ensamble canonico.

"""

@njit
def metropolis1(S, prob):
    """
    Realiza UN intento de cambio de espín (un solo sitio)
    usando el algoritmo de Metropolis.
    Devuelve:
      - S: configuración (posiblemente actualizada)
      - dm: cambio de magnetización por espín (Δm / L^2)
      - de: cambio de energía por espín (ΔE / L^2)
    """
    L = S.shape[0]
    L2 = L * L

    # Elegimos un sitio al azar mapeando un entero en (i, j)
    r = np.random.randint(L2)
    i, j = divmod(r, L)
    s_ij = S[i, j]

    # ΔE = 2 S_ij * suma de vecinos (cont. periódicas) para J=1
    dE = 2.0 * s_ij * (
        S[(i+1) % L, j] +   # abajo
        S[(i-1) % L, j] +   # arriba
        S[i, (j+1) % L] +   # derecha
        S[i, (j-1) % L]     # izquierda
    )

    dm = 0.0
    de = 0.0

    if dE <= 0.0:
        # Acepto siempre si la energía no aumenta
        S[i, j] = -s_ij
        dm = 2.0 * S[i, j] / L2   # Δm/L^2 = ±2/L^2
        de = dE / L2              # ΔE/L^2
    else:
        # Para dE > 0, uso prob[dE] con prob[4] y prob[8] ya definidos
        p = prob[int(dE)]         # dE sólo puede ser 4 u 8 en 2D con J=1
        if np.random.random() < p:
            S[i, j] = -s_ij
            dm = 2.0 * S[i, j] / L2
            de = dE / L2

    return S, dm, de

@njit
def metropolis(S, prob):
    """
    Un paso de Monte Carlo:
    aplica L^2 intentos de flip de espín sobre la red S.

    Devuelve:
      - S: configuración (posiblemente actualizada)
      - dm_total: cambio total de magnetización por espín (Δm / L^2)
      - de_total: cambio total de energía por espín (ΔE / L^2)
    """
    L = S.shape[0]
    L2 = L * L

    dm_total = 0.0
    de_total = 0.0

    for _ in range(L2):
        # Elegimos un sitio al azar
        r = np.random.randint(L2)
        i, j = divmod(r, L)
        s_ij = S[i, j]

        # ΔE = 2 S_ij * suma de vecinos (cond. periódicas), J = 1
        dE = 2.0 * s_ij * (
            S[(i+1) % L, j] +   # abajo
            S[(i-1) % L, j] +   # arriba
            S[i, (j+1) % L] +   # derecha
            S[i, (j-1) % L]     # izquierda
        )

        dm = 0.0
        de = 0.0

        if dE <= 0.0:
            # Acepto siempre
            S[i, j] = -s_ij
            dm = 2.0 * S[i, j] / L2   # Δm/L^2 = ±2/L^2
            de = dE / L2              # ΔE/L^2
        else:
            # Para dE > 0, uso prob[dE] con prob[4] y prob[8] ya definidos
            p = prob[int(dE)]         # dE ∈ {4, 8}
            if np.random.random() < p:
                S[i, j] = -s_ij
                dm = 2.0 * S[i, j] / L2
                de = dE / L2

        dm_total += dm
        de_total += de

    return S, dm_total, de_total

@njit
def metropolisN(S, prob, npasos):
    """
    Aplica 'npasos' pasos de Monte Carlo a la red S.

    Devuelve:
      - S: configuración final
      - mean_abs_m: <|m|>
      - mean_e: <e>
      - var_abs_m: Var(|m|)
      - var_e: Var(e)
    """
    L = S.shape[0]
    L2 = L * L

    m = np.empty(npasos)
    e = np.empty(npasos)

    # Magnetización inicial por espín
    m_actual = 0.0
    for i in range(L):
        for j in range(L):
            m_actual += S[i, j]
    m_actual /= L2

    # Energía inicial por espín
    e_actual = h(S)

    # Evolución temporal
    for t in range(npasos):
        dm_total = 0.0
        de_total = 0.0

        # Un paso de Monte Carlo: L^2 intentos de flip
        for _ in range(L2):
            r = np.random.randint(L2)
            i, j = divmod(r, L)
            s_ij = S[i, j]

            dE = 2.0 * s_ij * (
                S[(i+1) % L, j] +
                S[(i-1) % L, j] +
                S[i, (j+1) % L] +
                S[i, (j-1) % L]
            )

            dm = 0.0
            de = 0.0

            if dE <= 0.0:
                S[i, j] = -s_ij
                dm = 2.0 * S[i, j] / L2
                de = dE / L2
            else:
                p = prob[int(dE)]   # 4 u 8
                if np.random.random() < p:
                    S[i, j] = -s_ij
                    dm = 2.0 * S[i, j] / L2
                    de = dE / L2

            dm_total += dm
            de_total += de

        m_actual += dm_total
        e_actual += de_total

        m[t] = m_actual
        e[t] = e_actual

    # Observables de interés
    abs_m = np.empty(npasos)
    for t in range(npasos):
        abs_m[t] = abs(m[t])

    mean_abs_m = abs_m.mean()
    mean_e = e.mean()
    var_abs_m = abs_m.var()
    var_e = e.var()

    return S, mean_abs_m, mean_e, var_abs_m, var_e

