"""##Funcion de Termalizacion"""

@njit
def metropolisTermo(S, prob, nequilibrio):
    """
    Termaliza la red aplicando 'nequilibrio' pasos de Monte Carlo.
    NO devuelve observables, solo la red termalizada.
    """
    L = S.shape[0]
    L2 = L * L

    for _ in range(nequilibrio):
        # Un paso de Monte Carlo: L^2 intentos de flip
        for _ in range(L2):
            r = np.random.randint(L2)
            i, j = divmod(r, L)
            s_ij = S[i, j]

            # ΔE = 2 S_ij * suma de vecinos
            dE = 2.0 * s_ij * (
                S[(i+1) % L, j] +
                S[(i-1) % L, j] +
                S[i, (j+1) % L] +
                S[i, (j-1) % L]
            )

            if dE <= 0.0:
                S[i, j] = -s_ij
            else:
                p = prob[int(dE)]  # solo 4 u 8
                if np.random.random() < p:
                    S[i, j] = -s_ij

    return S

