"""## TRANSICION DE FASE

Calculamos el el valor medio del valor absoluto de la magnetización por partícula, la energía media por partícula, la susceptibilidad y el calor específico para varias temperaturas en un rango de **T=1K** y **T=3K** el objetivo es observar el comportamiento cuando la temperatura es cercana a la temperatura critica de la red infinita. Para el calculo de la suceptibilidad y el calor especifico consideramos que si tomamos κ=1 (tal que β=1T), puede deducirse que $$Cv=\beta^2(<E^2>−<E>^2)=β^2Var(E)$$ y análogamente $$\chi=β Var(M)$$.

Calculo los valores para una red de ising de **L = 35 X 35**
"""

L = 10                                                                        # Elijan L.
L2 = L * L
temperaturas = np.linspace(1, 3, 150)
betas = 1 / temperaturas

factor = 3000                                                                     # Factor para controlar los números de pasos.

nequilibriolejos = 3 * factor
npromediolejos   = 30 * factor
nequilibriocerca = 5 * factor
npromediocerca   = 300 * factor

mmedia = []                                                                       # Listas para guardar mediciones a cada T.
emedia = []
chi = []
c = []

S = np.ones((L, L), dtype=np.int32)                                              # Empezamos desde temperaturas bajas.
# S = 2 * np.random.randint(2, size=(L, L)).astype(np.int32) - 1                # Opción aleatoria.

centro = 2.3                                                                     # Aproximadamente donde está el máximo de χ.

for beta in tqdm(betas):

    # Vector de probabilidades: solo importan las posiciones 4 y 8
    prob = np.zeros(9)
    prob[4] = np.exp(-4.0 * beta)
    prob[8] = np.exp(-8.0 * beta)                                               # Coherente con dE = 4 u 8

    # Elegimos números de pasos según cercanía al "centro"
    if abs(1.0 / beta - centro) < 0.5:                                          # Ajustar si hace falta refinar
        nequilibrio = nequilibriocerca
        npromedio   = npromediocerca
    else:
        nequilibrio = nequilibriolejos
        npromedio   = npromediolejos

    S = metropolisTermo(S, prob, nequilibrio)                                   # Termaliza.

    # Mide <|m|>, <e>, Var(|m|), Var(e)
    S, m, e, varm, vare = metropolisN(S, prob, npromedio)

    mmedia.append(m)                                                             # <|m|> por espín
    emedia.append(e)                                                             # <e> por espín
    chi.append(beta * L2 * varm)                                                # χ = β L² Var(|m|)
    c.append(beta**2 * L2 * vare)                                               # c = β² L² Var(e)

