"""## Red Hexagonal

Redefinimos el hamiltoniano para una red hexagonal.

El hamiltoniano utilizado es $$H = -J \sum_{i,j} S_{i,j} S_{i, j-1} - J \sum_{\substack{i,j \\ (i+j) \in 2\mathbb{Z}}} S_{i,j} S_{i-1, j}.$$

La energia por particula entonces va a ser:

$$ h = \frac{H}{L^2}$$

Ademas, redefinimos la funcion que aplica el algoritmo de metropolis para esta configuracion. Esta funcion, al aplicarla sobre el estado s, devuelve un nuevo estado s y el incremento de la magentizacion (dm) y la energia (de). Consideramos primeros vecinos, por lo que solo tenemos 5 cambios de la energia posible al invertir un spin
ΔE=−2,−6,0,2,6

Si ΔE≤0 damos vuelta el spin, si en cambio ΔE>0 lo damos vuelta con probabilidad e−βΔE de tal manera que, luego de ser iterado varias veces, el algoritmo empiece a generar estados distribuidos segun el ensamble canonico.
"""

@njit
def h(S):
    L = S.shape[0]
    E = 0.0

    for i in range(L):
        for j in range(L):
            s = S[i, j]
            E -=  s * S[i, (j - 1) % L]
            if (i + j) % 2 == 0:
                E -= s * S[(i - 1) % L, j]
            else:
                E -=s * S[(i + 1) % L, j]
    return E / (L * L)

"""Me defino una función metropolis_aux para no calcular L muchas veces en metropolisN"""

@njit
def metropolishex_aux(S, prob, L, L2, J=1.0):
    # Choose random spin
    r = np.random.randint(L2)
    i, j = divmod(r, L)
    Sij = S[i, j]

    # Sum of neighbors in honeycomb lattice
    vecinos = S[i, (j + 1) % L] + S[i, (j - 1) % L]

    if (i + j) % 2 == 0:
        vecinos += S[(i - 1) % L, j]   # Up
    else:
        vecinos += S[(i + 1) % L, j]   # Down

    # Energy change for flipping this spin
    dE = 2.0 * J * Sij * vecinos

    # Magnetization & energy increments to return
    dm = 0.0
    de = 0.0

    # Metropolis acceptance
    if dE <= 0.0:
        accept = True
    else:
        # dE can only be 2J or 6J in honeycomb
        # map: 2J -> index 0   ;   6J -> index 1
        idx = int((dE - 2.0*J) / (4.0*J))
        if idx < 0:
            idx = 0
        elif idx > 1:
            idx = 1

        accept = (np.random.random() < prob[idx])

    if accept:
        S[i, j] = -Sij
        # ΔM per spin
        dm = -2.0 * Sij / L2
        # ΔE per spin
        de = dE / L2

    return S, dm, de

@njit
def metropolisN_hex(S, prob, npasos):
  L = S.shape[0]
  L2 = L * L
  m = np.empty(npasos)
  e = np.empty(npasos)
  for n in range(npasos):
    for __ in range(L2):
      S, dm, de = metropolishex_aux(S, prob, L, L2)
    m[n] = np.sum(S) / L2
    e[n] = h(S)
  abs_m = np.abs(m)
  return S, abs_m.mean(), e.mean(), abs_m.var(), e.var()

@njit
def metropolisTermo_hex(S, prob, nequilibrio):
    L = S.shape[0]
    L2 = L * L
    for _ in range(nequilibrio):
        for __ in range(L2):
            S, dm, de = metropolishex_aux(S, prob, L, L2)
    return S

"""Vuelvo a calcular el calor especifico y lo comparo con los valores teoricos"""

L = 22
L2 = L * L
temperaturas = np.linspace(1.3, 1.75, 30)
betas = 1 / temperaturas

factor = 5000

nequilibriolejos = 10 * factor
npromediolejos   = 20 * factor
nequilibriocerca = 15 * factor
npromediocerca   = 200 * factor


c = []

S = 2 * np.random.randint(2, size = (L, L)) - 1

for beta in tqdm(betas):
  prob = np.array([np.exp(-2 * beta), np.exp(-6 * beta)])
  centro = 1.5

  if abs(1 / beta - centro) < 0.25:
    nequilibrio = nequilibriocerca
    npromedio = npromediocerca
  else:
    nequilibrio = nequilibriolejos
    npromedio = npromediolejos

  S = metropolisTermo_hex(S, prob, nequilibrio)

  S, m, e, varm, vare = metropolisN_hex(S, prob, npromedio)
  c.append(beta**2 * L2 * vare)

